text:
I really should tweet this out everyday:

@realDonaldTrump is the most disloyal President we’ve ever had. He pressures foreign governments to sabotage our elections. He does whatever Putin tells him to do.

He’s not at all loyal to America. Call that whatever you want to call it.

Rick: I had Joe Walsh @WalshFreedom on earlier. I'd never thought I'd agree w/ him on anything.
Ben:  I disagree with Joe Walsh on just about everything but I think he believes in principles more than power, & the GOP has forgotten about that in recent decades.
@DadoftheDecade
